import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
const Resume = () => {
  const [resume, setResume] = useState([]);
  useEffect(() => {
    const getResume = async () => {
      const response = await axios.get("http://localhost:8080/user");
      let res = response.data.user;
      setResume(res);
    };
    getResume();
  }, []);
  return (
    <div class="container">
      <div class="section-title">
        <h2>Resume</h2>
        <p>
          Magnam dolores commodi suscipit. Necessitatibus eius consequatur ex
          aliquid fuga eum quidem. Sit sint consectetur velit. Quisquam quos
          quisquam cupiditate. Et nemo qui impedit suscipit alias ea. Quia
          fugiat sit in iste officiis commodi quidem hic quas.
        </p>
      </div>

      <div class="row">
        <div class="col-lg-6" data-aos="fade-up">
          <h3 class="resume-title">Sumary</h3>
          <div class="resume-item pb-0">
            <h4>Alex Smith</h4>
            <p>
              <em>
              A hard working, dedicated IT professional with
              years of experience In various NodeJS projects, 
              JavaScript, PostgreSQL, GIT,Clean Architecture.

              </em>
            </p>
            <ul>
              <li>Bengalore, India</li>
              <li>(123) 456-7891</li>
              <li>anweshachakraborty2021@gmail.com</li>
            </ul>
          </div>

          <h3 class="resume-title">Education</h3>
          <div class="resume-item">
            <h4>Master of Fine Arts &amp; Graphic Design</h4>
            <h5>2015 - 2016</h5>
            <p>
              <em>Rochester Institute of Technology, Rochester, NY</em>
            </p>
            <p>
              Qui deserunt veniam. Et sed aliquam labore tempore sed quisquam
              iusto autem sit. Ea vero voluptatum qui ut dignissimos deleniti
              nerada porti sand markend
            </p>
          </div>
          <div class="resume-item">
            <h4>Bachelor of Mathematics</h4>
            <h5>2011 - 2014</h5>
            <p>
              <em>Rochester Institute of Technology, Rochester, NY</em>
            </p>
            <p>
              Quia nobis sequi est occaecati aut. Repudiandae et iusto quae
              reiciendis et quis Eius vel ratione eius unde vitae rerum
              voluptates asperiores voluptatem Earum molestiae consequatur neque
              etlon sader mart dila
            </p>
          </div>
        </div>
        <div class="col-lg-6" data-aos="fade-up" data-aos-delay="100">
          <h3 class="resume-title">Professional Experience</h3>
          {resume.map((val) => {
            return (
              <>
                <div class="resume-item">
                  <h4>{val.designation}</h4>
                  <h5>{val.duration}</h5>
                  <p>
                    <em>{val.company}, {val.location}</em>
                  </p>
                  <ul>
                    {val.companies.map((vals) => {
                      return (
                        <li>
                          {vals.description}
                        </li>
                      );
                    })}
                  </ul>
                </div>
              </>
            );
          })}
        </div>
      </div>
    </div>
  );
};
export default Resume;
